import React from 'react';

import './style.scss'
import AlertDownload from '../AlertDownload';

function ButtonConverTo() {
  return (
    <>
      <AlertDownload />
      <button type="button" className="convert">Converter para PNG!</button>
    </>
  )
}

export default ButtonConverTo
